import React from "react";
import Navbar from "../components/Navbar";
import styled from "styled-components";
import {AuthContext} from "../myContext/myAuthContext";

const Container = styled.div`
  height: 100vh;
  width: 100%;
  background-color: #A239CA;
`;


const Home = () => {
    return (
        <div>
        <Navbar/>
        <Container>

        </Container>
        </div>
    );
}

export default Home;
